import { Component } from 'react';



class Page7 extends Component {
    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()
  }
    render() {
        return (
            <div className="sheet">
                <div className='left container_for_medium_margin'>
                    <p>Let's look at this website to think through the challenges you might have had.</p>
                    <div className='container_for_small_margin'>
                        <div id="instruction_box_number_1_step_1_script_6" className="custom_svg demo_box">
                            <p className='top_line_in_instruction_box'>
                                Share your screen!<br/>
                                Open <textarea onChange={event => this.handleChange(event)} id="text_box_number_1_page_7_script_6" defaultValue={this.getValue("text_box_number_1_page_7_script_6")} />  
                            </p>
                        </div>
                    </div>
                    
                </div>
            </div>
        )
    }
}
export default Page7;
